        super(props)
        this.state = {}

    }
    render() {
        const skills = [];
            for (let i = 0; i < this.state.numSkills; i += 1) {
                skills.push(<div id={"skill-"+String(i)}><button>X</button></div>);

            }

    return (
		<div className="skills">
            <h2 id="skills-title">Skills</h2>
            <hr></hr>
            <form>
            <input type="text" placeholder="Add a skill"></input>
            </form>
            {skills}
            <button>Add Skill</button>
            </div>)
    }
}

export default Skills;
